import React from "react";

import classes from "./Button.module.css";

function Button() {
  return (
    <div>
      <button
        className={style.button}
        type={props.type || "button"}
        onClick={props.onClick}
      >
        {props.children}
      </button>
    </div>
  );
}

export default Button;
